import './App.css';
import Counter from './Counter';
import Nav from './Nav';
import About from './About';
import { render } from "@testing-library/react";

function App() {
  return (
    <Router>
    <div className="App">
    <Nav/>
    <switch>
    <Route path="/" exact component={Home} />
     <Route path="/counter" component={Counter} />    
     <Route path="/about" component={About} />      
     </switch>     
    </div>
    </Router>
  );
}
